window.bookSummaryJSON = "<p>Geralt the Witcher battles monsters, demons and prejudices alike in <i>Sword of Destiny</i>, the second collection of adventures in Andrzej Sapkowskiâ€™s groundbreaking epic fantasy series that inspired the Netflix show and the hit video games.</p> <p>Geralt is a Witcher, a man whose magic powers, enhanced by long training and a mysterious elixir, have made him a brilliant fighter and a merciless hunter. Yet he is no ordinary killer: His targets are the multifarious monsters and vile fiends that ravage the land and attack the innocent.</p> <p><i>Sword of Destiny</i> is the follow up to <i>The Last Wish</i>, and together they are the perfect introduction to a one of a kind fantasy world.&nbsp;</p> <p>Witcher collections:</p> <p></p> <ul> <li><i>The Last Wish</i></li> <li><i>Sword of Destiny</i>&nbsp;</li> </ul> <p>Witcher novels:</p> <p></p> <ul> <li><i>Blood of Elves</i></li> <li><i>The Time of Contempt</i></li> <li><i>Baptism of Fire</i></li> <li><i>The Tower of Swallows</i></li> <li><i>Lady of the Lake</i></li> <li><i>Season of Storms</i>&nbsp;</li> </ul> <p>Hussite Trilogy:</p> <p></p> <ul> <li><i>The Tower of Fools</i></li> <li><i>Warriors of God</i></li> </ul> <p>Translated from original Polish by David French.</p>"; 
